void ImageDCT_float(float * pTDCT_res, IplImage_ * pImg_HM, float * pDCTpara, float * pTDCTpara)//DCT变换子程序
{
	int height = pImg_HM->height;
	int width = pImg_HM->width;
	int width_step = pImg_HM->width_step;

	memset(DCT_temp2, 0, (HM_W_H_H)*(pImg_HM->width)*sizeof(float));
	for (int i = 0; i < HM_W_H_H; i++)
	{
		for (int j = 0; j < height; j++)
		{
			int srcpos1 = i*pImg_HM->width;
			int srcpos2 = j*pImg_HM->width;
			float para = pDCTpara[i*height + j];
			for (int k = 0; k < pImg_HM->width; k += 8)
			{
				DCT_temp2[srcpos1 + k] += (para * pImg_HM->image_data[srcpos2 + k]);
				DCT_temp2[srcpos1 + k + 1] += (para * pImg_HM->image_data[srcpos2 + k + 1]);
				DCT_temp2[srcpos1 + k + 2] += (para * pImg_HM->image_data[srcpos2 + k + 2]);
				DCT_temp2[srcpos1 + k + 3] += (para * pImg_HM->image_data[srcpos2 + k + 3]) ;

				DCT_temp2[srcpos1 + k + 4] += (para * pImg_HM->image_data[srcpos2 + k + 4]);
				DCT_temp2[srcpos1 + k + 5] += (para * pImg_HM->image_data[srcpos2 + k + 5]);
				DCT_temp2[srcpos1 + k + 6] += (para * pImg_HM->image_data[srcpos2 + k + 6]);
				DCT_temp2[srcpos1 + k + 7] += (para * pImg_HM->image_data[srcpos2 + k + 7]);
			}
		}
	}

	float sum = 0;
	for (int i = 0; i < HM_W_H_H; i++)
	{
		for (int j = 0; j < HM_W_H_H; j++)
		{
			sum = 0;
			for (int k = 0; k < width; k++)
				sum += (DCT_temp2[i*width + k] * pTDCTpara[j*width + k]);
			pTDCT_res[i*width + j] = sum;
		}
	}
}

void ImageDCT(int * pTDCT_res, IplImage_ * pImg_HM, short * pDCTpara, short * pTDCTpara)//DCT变换子程序
{
	int height = pImg_HM->height;
	int width = pImg_HM->width;
	int width_step = pImg_HM->width_step;

	memset(DCT_temp, 0, (HM_W_H_H)*(pImg_HM->width)*sizeof(int));
	for (int i = 0; i < HM_W_H_H; i++)
	{
		for (int j = 0; j < height; j++)
		{
			int srcpos1 = i*pImg_HM->width;
			int srcpos2 = j*pImg_HM->width;
			short para = pDCTpara[i*height + j];
			for (int k = 0; k < pImg_HM->width; k += 8)
			{
				DCT_temp[srcpos1 + k] += (para * pImg_HM->image_data[srcpos2 + k]) >> 10;
				DCT_temp[srcpos1 + k + 1] += (para * pImg_HM->image_data[srcpos2 + k + 1]) >> 10;
				DCT_temp[srcpos1 + k + 2] += (para * pImg_HM->image_data[srcpos2 + k + 2]) >> 10;
				DCT_temp[srcpos1 + k + 3] += (para * pImg_HM->image_data[srcpos2 + k + 3]) >> 10;

				DCT_temp[srcpos1 + k + 4] += (para * pImg_HM->image_data[srcpos2 + k + 4]) >> 10;
				DCT_temp[srcpos1 + k + 5] += (para * pImg_HM->image_data[srcpos2 + k + 5]) >> 10;
				DCT_temp[srcpos1 + k + 6] += (para * pImg_HM->image_data[srcpos2 + k + 6]) >> 10;
				DCT_temp[srcpos1 + k + 7] += (para * pImg_HM->image_data[srcpos2 + k + 7]) >> 10;
			}
		}
	}

	int sum = 0;
	for (int i = 0; i < HM_W_H_H; i++)
	{
		for (int j = 0; j < HM_W_H_H; j++)
		{
			sum = 0;
			for (int k = 0; k < width; k++)
				sum += (DCT_temp[i*width + k] * pTDCTpara[j*width + k]) >> 10;
			pTDCT_res[i*width + j] = sum ;
		}
	}
}



int GetHMCode(unsigned char *_pHMCode, int *_pTDCT_info, int _width)
{
	int i = 0;
	int j = 0;
	float sum = 0;
	float avg = 0;

	for (i = 0; i < HM_W_H_H; i++)
	{
		for (j = 0; j < HM_W_H_W; j++)
		{
			sum += _pTDCT_info[i*_width + j];
		}
	}
	sum = sum - _pTDCT_info[0];

	avg = sum / (HM_W_H_H*HM_W_H_W);

	for (i = 0; i < HM_W_H_H; i++)
	{
		for (j = 0; j < HM_W_H_W; j++)
		{
			if (_pTDCT_info[i*_width + j] < avg)
			{
				_pHMCode[i*HM_W_H_H + j] = 0;
			}
			else
			{
				_pHMCode[i*HM_W_H_H + j] = 1;
			}
		}
	}

	return 0;
}


