	//最相似的模板

	//int xiabiao[HM_TEMPLATE_NUM] = { 0 };
	int xiabiao[3] = { 0 };
	volatile int tag = 0;
	int offset = 88888;
	for (int i = 0; i < 3; i++)
	{
		minHM = HMlen[0];
		for (int j = 1; j < _pHMPatten->validnum; j++)
		{
			if (HMlen[j] < minHM)
			{
				minHM = HMlen[j];
				tag = j;
			}
		}
		xiabiao[i] = tag;
		HMlen[tag] = HMlen[tag] + offset;  //加上一个大常数，这样在下一轮的循环中它就不会成为最小值
	}
	//循环结束，将大常数减掉还原真值
	HMlen[xiabiao[0]] = HMlen[xiabiao[0]] - offset;
	HMlen[xiabiao[1]] = HMlen[xiabiao[1]] - offset;
	HMlen[xiabiao[2]] = HMlen[xiabiao[2]] - offset;


	////	//冒泡排序找前几名//
